(15, 2, 12, 2, '2017-08-14', 'Nathan', 'Saadat', 'none@none.com', '310-435-3081', 'Not Provided', '', 'Rae emailed SteveP 8/14/17\r\nWould like wine racks or wine cooler installed in spec home', 'LA', 'CA', 1, '2017-08-19', '2017-08-19', '', '', '', '', '', 0, 1, 0, 'No', '2017-08-17 09:22:05', '2017-09-13 09:42:55'),
(16, 2, 12, 2, '2017-08-14', 'Heidi', 'Not Given', '', '310-614-8358', 'Not Provided', '', 'Kathleen sent to SteveP 8/14/17\r\nName: Heidi\r\n*With interior design team CRA\r\nLocation: Griffyn Club LA—customer initially said Woodland area\r\nBest number: 310-614-8358 (cell)\r\nSize:\r\nAdditional Information:\r\n•	The wine room/case was just recently built for the Griffyn Club LA. They noticed that the room isn’t being cooled properly, indicated by water on the floor, condensation, and other problems with the function and operations. She noted the room had glass doors that had no sealing, and were built with regular glass (not necessarily dual paned). She would like to have someone come out and evaluate what needs to be done so that the function and operations of the room could be restored so the room is cooled properly.\r\nI informed her you would be reaching out to her later today.\r\n', 'LA', 'CA', 2, '2018-08-18', '2018-08-18', '', '', '', '', '', 0, 20, 0, 'No', '2017-08-17 09:29:15', '2018-03-05 14:45:38'),
(17, 11, 9, 2, '2017-08-14', 'Mike', 'Not Given', '', '650-787-9763', '', '', 'Kathleen sent to SteveP 8/14/17\r\nNeeds a cooling unit replaced', '94024', 'CA', 5, '2018-08-25', '2018-08-25', '<p>8-15-17: current cooling unit was fixed I believe.&nbsp;</p>\r\n', '', '', '', '', 0, 16, 0, 'No', '2017-08-17 09:39:19', '2018-05-15 18:02:32'),
(18, 5, 9, 2, '2017-08-07', 'Victor', 'Not Provided', '', '415.871.3605', 'Not provided', '', 'Kathleen sent lead to SteveP 8/7/17\r\nCustomer was doing inventory on his wine in his wine cellar, when he noticed a puddle of water from his cooling unit. He has a Whisperkool which is about 10-12 years old, and it is leaking. The problem is the designer placed the cooling unit behind racking so that it is really hard to get to and to replace. The customer would like help purchasing and the installing the replacement cooling unit, but will also need help with ‘remodeling’ the part of the rack the unit was behind. Essentially, the racking will need to be cut to get the old unit out, and then repaired once the new unit replaces it. He would like to make the area where the cooling unit is more accessible, so he doesn’t have to cut apart his wine cellar in another 10 years when he needs to replace the new unit (or for any repairs). He does not particularly want a huge redesign, but rather maybe a way to lose some racking or adjust so that the new unit is accessible in nearly the same location as the old.\r\nHe would like a call back tomorrow so he can get this resolved quickly, since the unit is leaking quite a bit.\r\n', '94920', 'CA', 5, '2017-08-21', '2017-08-21', '<p>8-25-17: Sold Victor a Whisperkool SC Series 8000i. Thank you for the lead. :)</p>\r\n', '', '', '', '', 0, 34, 0, 'No', '2017-08-17 10:00:19', '2017-12-02 16:26:17'),
(19, 1, 9, 1, '2017-07-26', 'Lisa', 'Not Given', '', '415-866-5777', 'not provided', '', 'Kathleen sent lead to SteveP 7/26/17\r\nBest Contact time: anytime during the day\r\nSize: 81 ½ by 51 ½\r\nBottle Capacity: looking for 300-500 bottles\r\n\r\nAdditional Information:\r\n•	The customer is in the middle of a renovation, and has a General Contractor on hand. They are building a wine room and need wine racking and doors, as well as a cooling unit to be installed. I believe the installation would be coordinated with the GM.\r\n•	Looking for a transitional design (not too traditional and not too modern)\r\n•	Customer has some design ideas/pictures would like to send over.\r\n', '94188', 'CA', 1, '2018-08-21', '2018-08-21', '<p>7-28-17: follow call. left message</p>\r\n\r\n<p>8-28-17: Lisa said she&#39;d email dimensions. offered free shipping on Whisperkool cooling unit.&nbsp;</p>\r\n\r\n<p>9-27-17: follow up call...no response.</p>\r\n', '', '', '', '', 0, 20, 0, 'No', '2017-08-17 10:13:39', '2018-03-05 14:46:42'),
(20, 11, 9, 2, '2017-07-25', 'Andri & Stella (both business partners) ', 'Not Given', '', '415-999-4314 (Andri) & 415-602-1182 (Stella)', 'not provided', '', 'Kathleen sent lead to SteveP 7/25/17\r\nBest time: anytime (better in the mornings)\r\nProject type: commercial—for a small restaurant\r\nSize: couple of shelves (one in entrance) \r\n*have blueprints and design can send through e-mail\r\n\r\nMore details:\r\n•	sliding door, and glass display (it is in the center of the restaurant)\r\n•	restraint to open in a couple months so want to get it done before then\r\n•	would like to know a timeframe for completion of the project as well\r\n', '94123', 'SF', 1, '2018-08-21', '2018-08-21', '<p>7-25-17: Spoke to Stella...will send drawings and pictures of what she wants.&nbsp;</p>\r\n\r\n<p>8-2-17: follow up call...no repsonse.</p>\r\n\r\n<p>9-27-17: purchased wine rack kit racks online. would not say where</p>\r\n', '', '', '', '', 0, 16, 0, 'No', '2017-08-17 10:16:46', '2018-05-15 17:53:16'),
(21, 12, 9, 2, '2017-07-25', 'Nicole', 'Chouinard', 'chouinard68@msn.com', 'not provided', 'not provided', '', 'Kathleen sent lead to SteveP 7/25/7\r\nInformation:\r\n•	Nicole is an interior designer, and she is working with a client to design a big, new custom home. She is trying to convince her clients to build a wine cellar for entertaining guests—as they don’t particularly drink wine. However they have a lot of guests that drink wine. She is hoping that there is a cooling unit that will get cool enough to make the room like a refrigerator when they do not have wine in the room—so they can store sparkling water and other items in it.\r\n•	Nicole would like to know what options are available for cooling units that could function as a wine cellar cooling unit and get down to temperatures below a typical wine cellar cooling unit.\r\n•	Potentially, if she convinces the owners she may need a builder specifically for the wine cellar. She was thinking modern feel, with glass doors.\r\n \r\nI thought you would know the cooling units, and their temperature ranges/capabilities better than myself—and would be better suited for determining the nature of future products and potentially setting up to work with you on this project.\r\n', 'SF', 'CA', 1, '2018-08-21', '2018-08-21', '<p>7-25-17: emailed Nicole...no response</p>\r\n\r\n<p>8-16-17: emailed Nicole...no response.</p>\r\n\r\n<p>9-27-17: emailed Nicole...no response.</p>\r\n', '', '', '', '', 0, 16, 0, 'No', '2017-08-17 10:22:50', '2018-05-15 17:54:48'),
(22, 2, 12, 1, '2017-07-23', 'josh', 'ebrahemi', 'josh.ebra@nadel.com', '3102666833', 'not provided', '', '', 'LA', 'CA', 6, '2017-08-21', '2017-08-21', '', '', '', '', '', 0, 1, 0, 'No', '2017-08-17 10:26:00', '2017-08-17 10:41:25'),
(23, 1, 9, 2, '2017-07-19', 'Jerry', 'Not Given', '', '209.988.0123', 'not provided', '', 'Kathleen sent lead to SteveP 7/19/17\r\nBest contact time: anytime between 8-5\r\nSize: 9.5 ft by 11.5 ft\r\n\r\nAdditional information:\r\n•	Jerry has moved into a new home from the 1930’s. There is a cellar under the home with concrete walls that he would like to convert into a wine cellar. The walls would need work (plastering) and he has a good idea of the design he wants (one wall half racking and half storage, a table with chairs along another wall, and a wall with sunken areas with glass behind it that has a bottle opener. Would need to work on the door leading outside of the cellar to the outside, and would like to try to place the cooling unit in a crawl space beneath the home. He has 400 bottles he needs to store, and he is a contractor himself and would like someone who could work alongside him and could be partnered with. He has had a cellar before.\r\n', 'Brentwood, 94513', 'CA', 1, '2018-08-21', '2018-08-21', '<p>Spoke to Jerry many times over the past few months. He is on the fence on what he wants to do? Hoping to sell him some wine racks soon. Had two meetings in my store. He is looking for a cheap solution..</p>\r\n', '', '', '', '', 0, 20, 0, 'No', '2017-08-17 10:30:30', '2018-03-05 14:47:51'),
(24, 13, 9, 2, '2017-07-19', 'Tom', 'Not Given', '', '925.968.1201', 'not provided', '', 'Kathleen sent lead to SteveP 7/19/17\r\nSize of room: about 320 bottles in the room—it is a Viking wine vault (petite is what he said)\r\n\r\nMore information:\r\n•	This gentleman has had a wine vault for 33 years. He has had a cooling unit for this wine vault, and replaced the compressor for it once (the first lasted about 18 years). The cooling unit functions and is cooling the room, but is located in the garage. So when the garage gets above 90 degrees, the cooling unit rattles and is very loud. The owner would like to replace it with a new unit that is about the same size. He wants to make sure he protects the wine inside before anything happens to the cooling unit.\r\n', 'Danville', 'CA', 1, '2018-08-21', '2018-08-21', '<p>9-27-17: Spoke to Tom. His cooling unit is working fine and does need assistance that this time.&nbsp;</p>\r\n', '', '', '', '', 0, 16, 0, 'No', '2017-08-17 10:32:57', '2018-05-15 17:55:20'),
(25, 1, 9, 2, '2017-07-13', 'Erik', 'Not Given', '', '510.866.1551', 'not provided\r\n', '', 'Kathleen sent the lead to SteveP 7/13/17\r\nBest time to contact: 7am-5pm\r\nProject Type: residential\r\nProject size: in either two locations\r\n1) in-home is about 4ft by 6ft with 1 bottle depth\r\n2) in garage would be about 10ft by 8ft with 1-2 bottle depth\r\n\r\nAdditional project information:\r\n•	Customer is looking to build a modern wine cellar including purchase and installation of a cooling unit. \r\n•	They will either be building it in an area inside the home, or in the garage.\r\no	If in-home, they would like glass doors and to install the cooling unit in a cavity beneath the staircase inside. \r\no	If in the garage, the cooling unit will probably want to be installed below or above the cellar.\r\n•	The customer would like the wine cellar to be modern style, particularly interested in using glass doors.\r\n', 'SF', 'CA', 1, '2018-08-21', '2018-08-21', '<p>7-18-17: emailed CADs and quote to client</p>\r\n\r\n<p>7-25-17: spoke to client. Said he&#39;d call soon to discuss drawings.</p>\r\n\r\n<p>8-8-17: provided client revised shop drawings and quote.</p>\r\n\r\n<p>8-11-17: follow up call. no response.</p>\r\n\r\n<p>9-13-17: follow up call. no response.</p>\r\n\r\n<p>9-27-17: follow up call. no response.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', 0, 20, 0, 'No', '2017-08-17 10:38:39', '2018-03-05 14:49:37'),
(26, 2, 12, 1, '2017-07-10', 'GILBERT', 'ISSAI', 'jissaimd@hotmail.com', '8184371744', 'not provided', '', 'Tim sent lead to SteveP 7/10/17\r\nRoom Dimensions:  6 feet by 8 feet\r\nNotes: My house is in construction currently finishing up the framing. There is a 6X8 feet area which I would like to turn into a wine cellar. Thank you ', 'LA', 'CA', 1, '2017-08-21', '2017-08-21', '', '', '', '', '', 0, 1, 0, 'No', '2017-08-17 10:41:03', '2017-11-27 11:43:48'),
(30, 11, 9, 1, '2017-08-17', 'Tyler', 'Munson', 'tmunson@munsondesign.com', '4152154234', 'Not provided', '', '8/17/17 Lin sent to SteveP\r\nHow Can We Help:  Request a quote\r\nMessage: Interested in getting a preliminary design and quote for a walk-in cellar being built in my garage. Approximately 51\" x 44\". Lots of potential with a high ceiling, sloping upwards with the lowest point at 138\".\r\n', 'San Jose', 'CA', 1, '2018-08-31', '1969-12-31', '<p>8-20-17: spoke to Tyler...contractor doing cellar prep work...he will reach out asap for shop drawings and quote.</p>\r\n\r\n<p>8-28-17: emailed drawings and quote. He likes our design and said he&#39;d like to move forward. But still in prep stages on cellar.</p>\r\n\r\n<p>9-28-17: spoke to Tyler...still 2 months away</p>\r\n\r\n<p>12-1-17: emailed follow up. I heard he is shopping and has received a quote from Vigilant Cellars. :/ Waiting for his reponse. Will follow up again asap.&nbsp;</p>\r\n\r\n<p>12-4-17: Tyler said he with a competitor due to better pricing. It appears I&#39;ve lost a few IWC custom racking jobs due to my pricing. I&#39;ve been using a 70-75% mark up. Maybe I&#39;ll drop my profit percentage in the interest of closing some of these jobs.&nbsp;</p>\r\n', '', '', '', '', 0, 16, 0, 'No', '2017-08-22 10:14:32', '2018-05-15 17:55:48'),
(31, 2, 12, 2, '2017-08-18', 'Judith', 'Not Given', '', '310-344-8349', '', '', '8/18/17 Rae sent to SteveP\r\nWho: Judith from West Hollywood Development (real estate company)\r\nWhat: Has questions about insulating wine cellar (wine cellar is already built)\r\nWhen: Called earlier today, about an hour ago\r\nPhone: 310-344-8349', 'West Hollywood', 'CA', 1, '2018-08-31', '1969-12-31', '', '', '', '', '', 0, 20, 0, 'No', '2017-08-22 10:17:37', '2018-03-05 14:45:02'),
(32, 2, 12, 2, '2017-08-21', 'Naz', 'Not Given', '', '(818) 964-2431', 'not provided', '', '8/21/17 Rae sent to SteveP\r\nI just got off the phone with Naz, an interior designer in Los Angeles. She has a client who wants a wine cellar designed and built into the dining room area. The wine cellar will be small (holding from 150-300 bottles).\r\n\r\nI informed her that you would be in contact with her by the end of the day.\r\n\r\nNaz- (818) 964-2431 ', 'LA', 'CA', 1, '2018-08-31', '1969-12-31', '', '', '', '', '', 0, 20, 0, 'No', '2017-08-22 10:20:52', '2018-03-05 14:44:29'),
(33, 2, 12, 1, '2017-08-21', 'Ken', 'Pham', 'phamhoangk@Gmail.com', '7146514551', 'not provided', '', '8/21/17 sent to SteveP\r\nQuick Quote - Custom Wine Cellars Los Angeles \r\n \r\nName: Ken Pham\r\nEmail Address: phamhoangk@Gmail.com\r\nPhone Number: 7146514551\r\nState: Westminster\r\n', 'Westminster', 'CA', 1, '2017-08-31', '1969-12-31', '', '', '', '', '', 0, 1, 0, 'No', '2017-08-22 10:22:39', '2017-08-28 17:43:20'),
(36, 3, 9, 2, '2017-08-22', 'RIck', 'Not Provided', 'notprovided@email.com', '510.919.3033', 'not provided', '', '8/22/17 Kathleen sent to SteveP\r\nCustomer name: Rick (architect)\r\nBest contact number: 510.919.3033\r\nLocation: Oakland, 94611\r\nProject size: 5 ft by 5ft by 10 ft\r\nAdditional Information:\r\n•	Rick is the architect for a new home that is being built. The home is about 90% of the way finished. There is a small wine storage area in the house, that they would like to have a cooling unit installed for.\r\n•	They would like a ducted cooling unit so that it is quiet in the room, probably ducted to the garage.\r\n•	The wine cellar for this project is adjacent to the garage (that is the back wall), and has an attic space above it.\r\n•	He has received quotes from other individuals, but is looking for a someone reasonably priced he can work with on a long-term basis for several future projects (an on-going basis).\r\n', 'Oakland, 94611', 'CA', 1, '2017-08-24', '2017-08-31', '<p>8/24/17 Kathleen received a call back from Rick and he was quite upset, as no one had reached out to him within the past two days. I confirmed his phone number to ensure it was the correct one.</p>\r\n\r\n<p>Tim and Kathleen called Steve, he had called and left a message.Steve said he also delagated it to Michael.</p>\r\n\r\n<p>8-24-17 left message with Rick</p>\r\n\r\n<p>8-31-17: one of my preferred HVAC installers recognized this job as he had already made a site visit prior to me even hearing about it. He did&nbsp;not like the job for various complications...says it was a problem job. I suggested Rick reach out to Contra Costa Climate as I could not help him.&nbsp;</p>\r\n', '', '', '', '', 0, 34, 0, 'No', '2017-08-22 16:38:56', '2017-12-02 13:53:04'),
(38, 2, 26, 1, '2017-08-28', 'Adriana', 'Cuenca', 'adriana@donnamazzillidesign.com', '', '', '', 'Room Dimensions \r\n 	3\'-6\" x 9\'-9\" \r\nNote: \r\n 	Rectangular room in a residential dining room (Coral Gables, FL). Glass on one of the long sides. Could also have glass wrapping around one of the short sides. ', 'Coral Gables', 'FL', 1, '2017-08-28', '1969-12-31', '', '', '', '', '', 0, 1, 0, 'No', '2017-08-28 17:32:50', '2017-12-04 04:51:20'),
(39, 8, 9, 2, '2017-08-28', 'Steph', 'Hopper', '', '916.677.7905', '', '', 'Hey Steve,\r\n                Received another lead about 10 minutes ago in regards to converting a walk-in closet into a wine cellar. Please see the details below:\r\n\r\nCustomer name: Steph Hopper\r\nBest contact: 916.677.7905\r\nBest time: not available tomorrow morning, this afternoon or tomorrow afternoon\r\nLocation: Truckee, CA\r\nSize: 46 inches deep, 100 inches wide, 107 inches high\r\nAdditional Information:\r\n•	Doing a home remodel and would like to convert a walk-in closet into a wine cellar\r\n•	There is a contractor doing the remodel in the home who looked at it\r\no	he will be working on the floor in the wine cellar (tiling the floor)\r\n•	The hole has already been cut out for the wine cellar\r\n•	a lot in mind for the design and has examples—wants to maximum bottle storage— it is in game room and wants glass doors\r\n•	Also needs a cooling unit for the wine cellar\r\n•	She may want someone to complete the whole process or for us to work a little with her current contractor\r\n\r\nPlease contact Steph this afternoon or tomorrow afternoon.\r\n', 'Truckee', 'CA', 1, '2017-08-28', '1969-12-31', '<p>8-28-17: Discussed the wine cellar project with Beth Hopper.</p>\r\n\r\n<p>8-29-17: Submitted dimensions for our design and quote</p>\r\n\r\n<p>9-6-17: Emailed CADs/quote to Beth for her review</p>\r\n\r\n<p>9-13-17: Spoke to Beth about revised drawings/measurements</p>\r\n\r\n<p>9-27-17: Drywall next week...then final measurements for final wine rack drawings</p>\r\n\r\n<p>10-10-17: SOLD!!! Made the deal with Beth. Premium Redwood with Walnut Stain.</p>\r\n\r\n<p>I&#39;m the ultimate closer. ;)</p>\r\n', '', '', '', '', 0, 16, 0, 'No', '2017-08-28 17:38:47', '2017-12-02 16:23:29'),
(40, 2, 12, 1, '2017-08-26', 'Lorrie and Bob', 'Pethick', 'bpethick@comcast.net', '248-705-0343', '', '', 'sent to SteveP 8/28/17\r\n', 'Palos Verdes Estates', 'CA', 1, '2018-09-05', '1969-12-31', '<p>From: Mike Naylor<br />\r\nThis message is regarding a client of mine (Lorrie and Bob Pethick).</p>\r\n\r\n<p>They are closing escrow on their new home in Palos Verdes Estates next week.&nbsp;<br />\r\n&nbsp;<br />\r\nThey&rsquo;re in town for a brief period next week before they fly back to Michigan to start their move. &nbsp; I was hoping we could arrange someone to access the space they would like to use for a wine cellar. &nbsp; The ideal time is early morning 8-9:30am on Friday, Sept 8. &nbsp; &nbsp;Let me know if this is something we can arrange.</p>\r\n\r\n<p>Contact &nbsp;<br />\r\nMIKE NAYLOR | REMAX<br />\r\nCalBRE#01946379<br />\r\n310-686-9361 mobile<br />\r\n310-878-9494 office<br />\r\nmike@naylorproperties.com</p>\r\n', '', '', '', '', 0, 1, 0, 'No', '2017-08-28 17:40:28', '2018-01-08 06:11:07'),
(41, 13, 9, 2, '2017-08-28', 'Arlene', 'Not Given', '', 'home: 650-685-2222; cell: 650-892-6123 (attempt home first)', '', '', 'sent to SteveP 8/28/17\r\nHey Steve,\r\n                Received a call about 15-20 minutes ago with a lead from the CWCSF site for a broken cooling unit. The information is below:\r\n\r\nName: Arlene\r\nBest number: home: 650-685-2222; cell: 650-892-6123 (attempt home first)\r\nBest time: ASAP\r\nLocation: Hillsbourough (north peninsula)\r\nType: residential\r\nCurrent cooling unit: vigilant ductless split cooling system with an outdoor condenser\r\nAdditional Information:\r\n•	moved into the house with the wine cellar and cooling unit in there—had problems then and inefficiencies (such as freezing the contents of the cellar)\r\n•	July 2014—got a new system; have had problems on and off since then\r\n•	few months ago told a leak of refrigerant and was supposedly fixed\r\n•	Had an A/C technician check out and he believed the coil just needed to be replaced\r\n•	Now THE UNIT IS NOT WORKING AT ALL\r\n•	there is currently wine in the cellar that they are concerned will go bad\r\n\r\nPlease reach out to her as soon as possible, and let me know once you’ve received this lead.\r\n\r\nAlso, I have noticed more leads relating to cooling unit problems or installations—are these types of leads you would typically handle? Are they still good lead for you guys?\r\n', 'Hillsborough (north peninsula)', 'CA', 5, '2018-08-28', '1969-12-31', '<p>8-28-17: Tried to sell a replacement cooling unit. Arlene was set on getting it serviced. Suggested Marcucci HVAC to fix unit. Arlene will call if/when she needs a new one. Loved the customer service.</p>\r\n', '', '', '', '', 0, 16, 0, 'No', '2017-08-28 17:42:47', '2018-05-15 18:03:23'),
(43, 2, 9, 1, '2017-08-24', 'Josh', 'Decolongon', 'joshua.decolongon@gmail.com', '4154162098', '', '', 'Message Body:\r\nName:   Josh Decolongon\r\nEmail:  joshua.decolongon@gmail.com\r\nPhone:  4154162098\r\nCity:   San Francisco\r\nHow Can We Help:  Request a quote\r\nMessage: Hi there! I’m looking to build a wine cellar in a newly built room, and I’m looking for some design suggestions and quotes. The specs are as follows: height is 94 inches; width is 88 inches; and length is 173 inches. Here’s a link to show the length and width with the door and with a column in one corner which changes measurements in one corner: https://image.ibb.co/ce0xe5/winecellar.jpg\r\n\r\nWe’re looking to maximize room for bottles and we’re also looking for a more modern or futuristic feel: to us, that means less wood and more metal or other material. We’re open to any suggestions on design, though the cellars listed on your website under your “recent projects” tab that is closest to my vision is this one: http://www.customwinecellarssanfrancisco.com/build-storage-clients-california/modern-residential-wine-cellar-cooling/\r\n\r\nThanks. I look forward to hearing back from you!\r\n\r\nCheers,\r\nJosh', 'San Francisco', 'CA', 1, '2017-08-29', '1969-12-31', '<p>8-24-17: emailed Josh. He&#39;s ready for shop drawings and a quote.</p>\r\n\r\n<p>8-24-17: started our metal peg rack drawings and quote with Daniel</p>\r\n\r\n<p>8-30-17: emailed drawings and quote to Josh</p>\r\n\r\n<p>9-4-17: emailed follow up and left voicemail...no response</p>\r\n\r\n<p>9-13-17: emailed follow up.</p>\r\n\r\n<p>9-27-17: spoke to Josh...says he is not ready. I got the feeling he was unhappy with the price.&nbsp;</p>\r\n', '', '', '', '', 0, 34, 0, 'No', '2017-08-29 10:33:00', '2017-12-02 13:57:56'),
