(81, 11, 9, 1, '2017-09-07', 'Tracey', 'Weber', 'tjjweber@comcast.net', '9255254553', '', '', 'Sent to Steve 9/7/17\r\nSubject: Custom Wine Cellars San Francisco Form\r\n\r\nMessage Body:\r\nName:   Tracey Weber\r\nEmail:  tjjweber@comcast.net\r\nPhone:  9255254553\r\nCity:   Pleasanton\r\nHow Can We Help:  Speak with a Specialist\r\nMessage: We have a lake home in Copperopolis and we are looking to change out a set of solid doors with doors with glass so you can see into our wine closet.  Would like to discuss that with someone or get ideas on what might work.\r\n\r\n925-525-4553\r\n', 'Pleasanton', 'CA', 1, '2018-09-08', '1969-12-31', '<p>9-12-17: Tracey will send over door pictures of what she wants</p>\r\n\r\n<p>9-20-17: emailed door quote</p>\r\n\r\n<p>9-26-17: make follow call</p>\r\n\r\n<p>9-30-17: Tracey advised our door is too expensive for a Lake House. Will Call if anything changes.</p>\r\n', '', '', '', '', 0, 16, 0, 'No', '2017-09-18 08:34:56', '2018-05-15 17:57:28'),
(82, 1, 9, 1, '2017-09-08', 'Grace', 'Zhu', 'grace@canvasinfotech.com', '4156069225', '', '', 'sent to Steve 9/8/17\r\nHi Steve\r\n\r\nPlease see forwarded email for client\'s contact information; she is looking to build a wine cellar for her boss\'s house and is looking for an in-house consultation\r\n\r\nFrom: Grace Zhu <grace@canvasinfotech.com>\r\nSubject: Custom Wine Cellars San Francisco Form\r\n\r\nMessage Body:\r\nName:   Grace Zhu\r\nEmail:  grace@canvasinfotech.com\r\nPhone:  4156069225\r\nCity:   Fremont\r\nHow Can We Help:  Speak with a Specialist\r\nMessage: Hello,\r\n\r\nI am interested in building a wine cellar/cooler for my boss\'s house. I was wondering you offer in-house consultation or a pre-inspection to check out the space first before committing to a project. We are currently brainstorming where and how to install, so having help from a specialist is greatly needed!\r\n', 'Fremont', 'CA', 1, '2017-09-09', '1969-12-31', '<p>9-9-17: Spoke to Grace. She will have a contractor demo room and contact me for a design and quote when ready. Few months out.</p>\r\n', '', '', '', '', 0, 34, 0, 'No', '2017-09-18 08:58:34', '2017-12-02 16:55:28'),
