(84, 1, 9, 1, '2017-09-11', 'Sandy', 'Bennett', '', '510-917-3334', '', '', 'sent to Steve 9/11/17\r\nHey Steve,\r\n                I received another lead from the CWCSF site about 15 minutes ago. Here is the information I received from the individual when speaking with them:\r\n\r\nCustomer Name: Sandy Bennett\r\nBest Number: 510-917-3334\r\nBest time: anytime\r\nLocation: Danville\r\nType: Residential\r\nSize: 5-6ft wide—not certain because not sure what space will work within the area they are looking at\r\nBottle Capacity: unknown, but wants it to be substantial\r\nAdditional Information:\r\n•	Really looking for someone who can COME TO THE HOME to look at the space and help advise with design. All other companies they have talked to stated they cannot come look at the space and that they would not be able to install the glass walls.\r\n•	The customer would like to get glass walls installed, but is uncertain of the location just based on what will work design wise.\r\n•	Looking for help from A to Z with building out the niche in the home into a wine cellar\r\n', 'Danville', 'CA', 1, '2017-09-12', '1969-12-31', '<p>sent to Steve 9/12/17</p>\r\n\r\n<p>Hey Steve,</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Just received a call back from Tracy&mdash;she was the individual who provided me the information for Sandy yesterday and requested Sandy be reached out to.</p>\r\n\r\n<p>Tracy mentioned Sandy had not been reached yet, and she wanted to ensure her client would be reached. I informed Tracy yesterday that if we missed her, a voicemail would be left with instructions to reach your team at.</p>\r\n', '', '<p>9-12-17: Met with Sandy in my store. She works near by. Hoping to start some projects for her. This current lead in Danville she said she&#39;d contact me when ready.&nbsp;</p>\r\n', '', '', 0, 34, 0, 'No', '2017-09-18 09:03:42', '2017-12-02 17:04:40'),
