(339, 1, 9, 1, '2017-11-06', 'Dylan ', 'Hyggart', 'dylan.haggart@gmail.com', '415.283.9200', '', '', 'Hi – hope you’re doing well. I’m hoping to discuss wine cellar design options and get a quote for a project. I\'m not sure what the scope of your design offerings include, but some information on our project is below.\r\n\r\nWe’ve recently bought a new home that has a backyard ‘work room’ which we’d like to convert into a wine cellar. We’re leaning towards a more contemporary design style, and want to incorporate finishes that are similar to the rest of our house. We’re still figuring out exactly what we need, but something along the lines of the following:\r\n\r\n    Storage for ~500 bottles – a mix of single and bulk storage, with room for ~10 larger format bottles\r\n    Wine needs refrigeration / temperature control\r\n    Bar counter-top with sink\r\n    Small freezer and refrigeration unit\r\n    Glassware storage\r\n    Small space for cigars (<50)\r\n\r\nRoom specs:\r\n\r\n    110sq feet (10ft x 11ft footprint)\r\n    Structure is fully insulated with a poured cement floor\r\n    Structure has running water\r\n\r\nWe live in the Pacific Heights neighborhood of San Francisco. Look forward to connecting,\r\n\r\nDylan', 'San Francisco ', 'CA', 1, '2017-11-07', '1969-12-31', '<p>Left message with customer.&nbsp;</p>\r\n\r\n<p>11-7-17: left message with customer.&nbsp;</p>\r\n\r\n<p>11-16-17: left message with customer.</p>\r\n', '', '', '', '', 0, 34, 0, 'No', '2017-11-06 07:33:28', '2017-12-04 14:40:07'),
