(376, 2, 33, 1, '2017-11-07', 'Bill', 'Switzenberg', 'bswittyf100@gmail.com', '949.274.2295', '', 'https://www.incorporationattorney.com/schedule-a-free-meeting-business-lawyers-orange-county-california', 'We have three members of 2 separate LLC\'s which hold the majority of the Membership Interest. The LLC\'s comprise of promissory notes (1 each) on installment sales of industrial properties in Orange County CA. Our operating agreements state with that majority we can amend the agreements. The amendments are to remove the current Manager, who is also a member) and their decision making powers. Then we will instate those powers to members holding the majority of the Membership Interest. I can email you the operating agreement ( both are identical) and our plans on how to achieve our goals. We know we have the right to amend the agreements but want to make sure everything we\'re doing is legal and leaves the current Manager without legal recourse. We also have a question about section 18.4 and how it relates to our quest. A phone meeting would be best for me do to I\'m building a home in Colorado.\r\nBill', 'Not Specified', 'Not Specified', 6, '2018-11-07', '2018-11-07', '', '', '', '', '', 0, 20, 0, 'No', '2017-11-07 15:53:11', '2018-03-05 14:27:29'),
