(495, 2, 33, 1, '2017-11-14', 'Robert', 'Atkinson', 'robatkinson0687@gmail.com', '9252474749', '', 'https://www.incorporationattorney.com/incorporation-attorneys-california-about', 'I was recommended by a friend to connect with Andy from your company.\r\n\r\nHere\'s a quick overview of my situation:\r\n\r\nI\'ll keep this email as brief as possible. Basically, I\'m in a sue happy industry with one of my websites. It\'s reasonable to expect I will get sued sometime in the next couple of years and would like to have a business structure that limits my personal and business asset exposure.\r\n\r\nThings I\'ve thought about (no idea if I\'m way off or not):\r\n\r\n-Setting up a business(es) outside of California (ie, Wyoming)\r\n-Having a business structure that limits the chances of piercing through to my personal assets (is a traditional corp setup better than LLC?)\r\n-Having a separate business for each one of my major websites (so if one gets sued the whole company doesn\'t go down).\r\n-Having a trust own the main business to further separate me from the ownership of the corporation/LLC.', 'Not Specified', 'Not Specified', 6, '2018-11-14', '2018-11-14', '', '', '', '', '', 0, 20, 0, 'No', '2017-11-14 15:28:42', '2018-03-05 14:23:54'),
