(537, 2, 33, 1, '2017-12-02', 'Nima RYAN', 'MORADIAN', 'fatnima@gmail.com', '9494660564', '', 'https://www.incorporationattorney.com/incorporation-attorneys-california-about', 'I hope your holiday season is going well. My name is Nima and i am emailing you as i came across your firm and wanted to get a quote for some services. \r\n\r\nquick backstory, i am an ER physician and am starting with a new group in Orange County/LA where i will be an “independent contractor” with the ED group whom is contracted out by the hospital, thus not directly working for the hospital. i have done some research and gotten advice to start an S-corp as a licensed professional. This is where i would need some help, seeing that my line of work is riddled with legal jargon and bureaucracy i believe having your counsel involved in my starting of this endeavor would be wise.  \r\n\r\ni do have some more detailed questions in regards to this topic because my wife is also a physician and will be in the same situation next fall and we may want to join together to form a single S-corp. i believe we will benefit from large tax fee savings by doing this together as a single S-corp, however i was also told that there may be issues with liability? further can i simply start it by myself and add her one later for time sake? lastly i was also advised that starting this endeavor with the state one should wait until the last 2 weeks of the year to avoid paying tax fees for 2017 when not yet functionally necessary (not until late January 2018 in my case). \r\n\r\nfurthermore i may have interest in your legal counsel in looking over my new contract. if all goes well i will definitely have further business contracts that need reviewing in the future other business legal counsel needs.\r\n\r\nlastly have you ever worked with a physician starting an independent contractor/s-corp?\r\n\r\ni understand that answering some of these questions may be too in depth for an introductory email, thus at least some general quotes to start with and get you on board with my line of thinking thus far i guess. thank you so much for your time and i look forward to a response.\r\n\r\nsincerely,\r\nNima R Moradian, DO, MS', 'Not Specified', 'Not Specified', 6, '2018-12-02', '2018-12-02', '', '', '', '', '', 0, 20, 0, 'No', '2017-12-02 10:07:13', '2018-03-05 14:17:21'),
