(581, 6, 33, 1, '2017-12-19', 'Erica', 'Francis', 'efrancis@readyjob.org', '800-445-2929', '', 'https://www.incorporationattorney.com/incorporation-attorneys-california-about', 'Hello,\r\n\r\nIn the U.S., it is very difficult for people with disabilities to find adequate employment (http://money.cnn.com/2015/07/26/news/economy/americans-with-disabilities-act-problems-remain/). Despite equal opportunity laws, many people with disabilities are either underemployed or unemployed.\r\n\r\nThis lack of opportunity encourages many people with disabilities to become entrepreneurs, and the rise of today’s sharing economy means now there are even more ways for people with disabilities to become business owners. \r\n\r\nCan I write an article for your website? It will provide tips for people with disabilities who are considering taking the plunge into business ownership, from what types of businesses to consider to how to get funding to how to find customers. \r\n\r\nIf you’re interested in receiving an article, please let me know.\r\n\r\nThank you!\r\nErica\r\n\r\nErica Francis\r\nReadyjob.org\r\nefrancis@readyjob.org\r\n', 'Not Specified', 'Not Specified', 6, '2018-12-19', '2018-12-19', '', '', '', '', '', 0, 16, 0, 'No', '2017-12-19 21:44:46', '2018-03-05 14:12:55'),
