(748, 2, 33, 1, '2018-01-07', 'miki sawhney', 'Not Specified', 'miki.sawhney@gmail.com', '8569942580', '', 'https://www.incorporationattorney.com/schedule-a-free-meeting-business-lawyers-orange-county-california', 'Hi,\r\n\r\nWe need your legal advise on our case as i am working as an Emploee / investing partner in one of the Company\'s  store.\r\n\r\nAs per my agreement signed 7 months ago, i am not getting my profit share being a 33% financial investor.  Also they are hiding all the right numbers of income and expense from me. But as per the agreement they have to provide all the financial documents every month but till today i haven\'t got any financial documents despite sending several emails.\r\n\r\nI can provide you the copy of my agreement and my final communication to the head of the company, which will give you all the required facts and details about the case.I can also provide all the statements which they send me every month without the financial documents.\r\n\r\nAlso i am not getting other profits which i suppose to get as financial investor.\r\n\r\nIf you think you can help us in this matter, then please let us know your availability to discuss further.\r\n\r\nThanks', 'Not Specified', 'Not Specified', 6, '2018-01-07', '2018-01-07', '', '', '', NULL, '', 0, 0, 0, 'No', '2018-01-07 23:15:31', '2018-01-07 23:15:31'),
