16)-660-5266 Ext. 110\r\nBest Regards,                                                                                                                                                                                   \r\nKen Adam                                                                                                                                                                                            \r\nSenior Account Manager                                                                                                                              Phone: (916)-660-5266 Ext. 110                                                                                                             Email: ken@prontochat.com                                                                                     http://www.prontochat.com \r\n', 'Yuba City,', 'CA', 6, '2018-01-22', '2018-01-22', '', '', '', '', '', 0, 20, 0, 'No', '2018-01-22 07:10:16', '2018-03-05 13:30:23'),
