(909, 6, 33, 1, '2018-02-13', 'Grant', 'Polachek', 'grantp@squadhelp.com', '8665454965', '', 'https://www.incorporationattorney.com/incorporation-attorneys-california-about', 'Greetings from Chicago!\r\n\r\nI am sending this email to explore a potential partnership opportunity with your company. \r\n\r\nBy disrupting the traditional agency model, Squadhelp has helped more than 15,000 companies across dozens of industries (predominantly startups) develop strong brands and succeed faster. \r\n\r\nWe get hundreds of customers every week who are in the first stage of their business - and most of them will need incorporation and registration services.  We are in the process of creating a shortlist of preferred partners, who can offer business filing services to our customers for different regions. We’d love to partner with those businesses who could in turn recommend our services to their customers for logo design, naming, and taglines. \r\n\r\nPlease let us know if you’re interested in exploring this partnership opportunity. \r\n\r\nSquadhelp Background: Squadhelp.com is an innovative crowdsourcing platform - featured in The Next Web, Forbes, and the Tribune -  that helps companies come up with great names for their business or brand by engaging our community of 70,000+ Creatives. By disrupting the traditional agency model, Squadhelp has helped develop more than 15,000 brand names across hundreds of industries.\r\n\r\nThanks,\r\nGrant', 'Not Specified', 'Not Specified', 6, '2018-02-13', '2018-02-13', '', '', '', '', '', 0, 16, 0, 'No', '2018-02-13 02:19:46', '2018-03-05 12:43:20'),
