(912, 2, 38, 1, '2018-02-13', 'Mark', 'Jones', 'mark@cerdaenterprises.com', '559 2170930', '', 'http://www.bluegrousewinecellars.com/Wine-Cellar-Designs-Free-3D-Request-Vancouver-Office.html', 'This is for a restaurant. We are looking for a glass enclosed cooled wine storage area that will be visible to the public. We would like it to be 2 bottles wide laying on there sides so labels can be viewed and just 1 bottle deep and about 8\' tall. This would supported by sitting on the floor and secured to a wall behind it. So the 2 bottle wide face would be a glass door and glass walls on both sides. Can we get a rough idea of what this would cost?  ', 'Fresno', 'Ca', 6, '2018-02-13', '2018-02-13', '', '', '', NULL, '', 0, 0, 0, 'No', '2018-02-13 10:43:49', '2018-02-13 10:43:49'),
(913, 2, 30, 1, '2018-02-13', 'Brian', 'Quick', 'bquick@Miniwarehousing.com', '978-697-8347', '', 'https://www.winecellarsbycoastal.com/custom-wine-cellar-doors.aspx', 'Looking for a square 36\" wine cellar door that is insulated.  ', 'Mansfield', 'MA', 6, '2018-02-13', '2018-02-13', '', '', '', NULL, '', 0, 0, 0, 'No', '2018-02-13 12:12:13', '2018-02-13 12:12:13'),
(914, 2, 33, 1, '2018-02-13', 'Victor', 'Tu', 'victor.tu1776@gmail.com', '9494109365', '', 'https://www.incorporationattorney.com/incorporation-attorneys-california-about', 'Hello,\r\n\r\nThank you for reading my email. I need some guidance on an LLC that I formed.\r\n\r\nTo quickly summarize:\r\n- I formed an LLC with a partner in December 2015.\r\n- I sold my share of the LLC to my partner in November of 2016.\r\n- I signed a contract in November 2016 selling my share.\r\n- I resigned a new contract with my partner in May 2017 restating that I sold him my share of the business to him in full.\r\n- I did not update the Statement of information for the business with the removal of myself as an owner/member until January of 2018.\r\n- I finally removed myself from the bank account of the LLC in early February of 2018.\r\n\r\nMy question is, are there any other steps I need to do to remove myself and my liability from any part of the business? When I closed my business bank account, the business banker told me that I had to send a document to the secretary of state of California to notify them that I had left the company and sold my share to my partner. I thought that this was already sufficient with the Statement of information, however she said that when she did a business search on the secretary of state, that it showed the original registration date, and that it should show a more recent registration date if I had successfully updated the information to show I am no longer a member/owner.\r\n\r\nAnother question I have is that I was the one who obtained the EIN for the business. Are there any steps I need to take to notify the IRS that I am no longer responsible for the EIN?\r\n\r\nAre there any other steps I should take to make sure I am fully removed from the business?\r\n\r\nI appreciate your help and guidance on this issue.\r\n\r\nBest,\r\nVictor Tu', 'Not Specified', 'Not Specified', 6, '2018-02-13', '2018-02-13', '', '', '', '', '', 0, 20, 0, 'No', '2018-02-13 12:20:17', '2018-03-05 12:43:57'),
(915, 2, 12, 2, '2018-02-14', 'Roger', 'Not Given', '', '626-372-4421', '', '', 'Roger needs a cellar built in a new construction. The space is 50 in long, 40 inch wide and 10 ft tall. He\'d like the cellar to be enclosed in glass. Needs refrigeration and racking. He is not sure if the racks should be wood or metal, needs design help and would like someone to see the space and help him decide on racking. Roger would like an estimate of how much the project will cost.  ', 'Woodland Hills/ LA', 'CA', 1, '2018-02-14', '1969-12-31', '', '', '', '', '', 0, 20, 0, 'No', '2018-02-14 11:40:14', '2018-03-05 13:53:24'),
