(919, 6, 9, 1, '2018-02-15', 'Garry', '', 'garry@skylineestimation.com', '5124877162', '', 'https://www.customwinecellarssanfrancisco.com/contact-2/', 'Hi,\r\n\r\nHope you are doing great! \r\n\r\nSkyline Estimation Offers an appealing discount on estimation and quantities take off. Giving us an opportunity to provide you with our estimation services would eventually make you realize that we are the best option for you to outsource your job. \r\n\r\nSkyline offers the most practical and focused construction cost estimating solutions.\r\n\r\nWe are specialized in the following trades: \r\nCarpentry \r\nFlooring \r\nInsulation \r\nDrywall \r\nMasonry \r\nOpening \r\nRenovation \r\nDemolitions \r\nSteel Structures \r\nFacade Work \r\nConcrete \r\nRoofing \r\nExterior/Interior Works \r\nMechanical/Electrical Plumbing \r\nPainting\r\nLandscaping \r\n\r\nPlease, let me know if there is any procedure to work with you or do send me the drawings/plans(PDF Files). \r\n\r\nAs soon as we get the drawings we’ll provide you with an economical proposal shortly. \r\n\r\nLooking forward to hear from you soon. \r\n\r\nThanks,\r\n\r\n\r\n\r\nKind Regards,\r\n\r\n\r\nGarry Vince | Business Development Manager\r\nEstimation Dept - Skyline Estimation Inc.\r\nEmail:  Garry[ @ ]Skyline Estimation[ . ]com\r\n1000 Heritage Center Circle,\r\nRound Rock, Texas 78664\r\nOffice : 512-487-7162', 'Round Rock,', '', 6, '2018-02-15', '2018-02-15', '', '', '', '', '', 0, 20, 0, 'No', '2018-02-15 13:15:47', '2018-03-05 13:14:14'),
