stchester Woodworking Colchester, CT\r\nCabinetmaker \r\nCabinet manufacture: From raw to finished product, Installation,\r\n\r\n2/09-8/09, 3/11-11/11\r\nLepont Woodworking Sterling, MA\r\nFinish Carpenter \r\nInstall of crown base doors, Beadboard walls\r\n\r\n11/10-2-11\r\n Heartwood Furniture Eagle, CO\r\nCabinetmaker \r\nmanufacturing of cabinets, assembly of cabinets\r\n \r\n6/10-11/10  \r\nJFC Construction Martinez, CA\r\nWoodworker \r\nmanufacturing of Mortise and tenon doors\r\n \r\n1/10 – 5/10\r\nFurniture by Dovetail Holden, MA\r\nCabinetmaker \r\nManufacturing of Marine cabinets\r\n \r\n10/09 – 12/09\r\nGH Interiors Flemmington, NJ\r\nWoodworker, Carpenter\r\nGeneral woodworking, Finish carpentry\r\n \r\n8/09 – 10/09 \r\nCWF Newton, NJ\r\nWoodworker Manufacturing of production furniture\r\n \r\n2002 – 2008 \r\nLost Art Joinery Lebanon, CT\r\nWoodworking, and General Carpentry \r\nFrom raw to finished product; Manufacture, Windows, Doors, Cabinetry, Molding Frame, Trim, Demolition, and Installation\r\n\r\nEDUCATION\r\n 1985-1989 RHAM HIGH SCHOOL, Hebron, CT\r\nGeneral Diploma \r\n\r\n\r\nhttps://goo.gl/photos/4R6kLH1gKyjZa6E66', 'Larkspur ', '', 6, '2018-02-18', '2018-02-18', '', '', '', '', '', 0, 16, 0, 'No', '2018-02-18 09:34:08', '2018-03-05 12:57:44'),
