(1011, 2, 46, 1, '2018-03-01', 'Joann', 'Ventimiglio', 'jventimiglio42@gmx.com', '7327039739', '', 'https://www.accool.net/contact/', 'Hi AC Cool, Inc\r\n\r\nWe are Interested in your product/Service.\r\nPlease revert back to us with necessary details ( jventimiglio42@gmx.com ).\r\n\r\nRegards\r\nMs. Joann Ventimiglio.', 'Orange', 'CA ', 6, '2018-03-01', '2018-03-01', '', '', '', '', '', 0, 1, 0, 'No', '2018-03-01 06:35:48', '2018-04-19 23:18:55'),
(1012, 6, 9, 1, '2018-03-01', 'Ake', 'Grunditz', 'ake@grunditzart.com', '510 220 8304', '', 'https://www.customwinecellarssanfrancisco.com/contact-2/', 'Hi There,\r\n\r\nWe are Fine Design, an Alameda, CA based artist team that has been creating unique, hand carved stone carvings for wine cellars since 1991.  Our emphasis is on creating ornaments which have special meaning to our clients… custom pieces, different from precast work available in stores or on line. Our work is especially well suited for wine cellar door keystones, arches and niches. …the carvings add a wonderful, personal and artistic touch to any cellar!  \r\nAll our work is hand carved and one of a kind, no molds are used. We make all our own drawings and patterns, and work in all styles and periods of ornamentation. We often create the carvings in our studio as loose pieces, which can then easily be installed by contractors. However, we also field apply and sculpt the material directly on the jobsite. This enables us to make larger, more complex ornaments. \r\n\r\nPlease explore our website www.finedesigncarving.com to see photos of our wine related carvings.\r\n\r\nPlease give me a call at 510 220 8304 if you want more information, or wish to set up a meeting to discuss possible collaboration.\r\n\r\nOur hope is that we can provide you with yet another resource to enhance your wine cellars!\r\n\r\nBest Regards\r\n\r\nÅke Grunditz', 'Alameda', '', 6, '2018-03-01', '2018-03-01', '', '', '', '', '', 0, 16, 0, 'No', '2018-03-01 14:31:58', '2018-03-05 12:49:45'),
