(1185, 2, 33, 1, '2018-04-03', 'claudia', 'nova', 'claudia_nova@sbcglobal.net', '7148722176', '', 'https://www.incorporationattorney.com/incorporate-form-a-corporation-california', 'I help my husband run his business. He is currently registered as a sole proprietor. He is a painter contractor and does mainly work for UCI. \r\n\r\n2017 was his first year owning his own company. This year he is very busy to the point where we might need to incorporate in order to take advantage of the tax benefits.  \r\n\r\nI can probably do all the paperwork online myself but I was curious how much this type of service would cost if we were to hire an attorney. Since he has to be DIR compliant, things are a bit complicated and I would rather not carry the burden of making a mistake that could cost us more down the line.\r\n\r\nHow much do you charge to incorporate a business and apply for a federal tax ID?\r\n\r\nThank you', 'Not Specified', 'Not Specified', 6, '2018-04-03', '2018-04-03', '', '', '', '', '', 0, 1, 0, 'No', '2018-04-03 16:36:45', '2018-04-05 07:48:16'),
(1186, 6, 35, 1, '2018-04-03', 'Larry', 'Mager', 'larry@readybrain.net', '214-524-0458', '', 'http://www.galeandvallance.com/contacts/', 'Hi there, \r\n\r\nAfter being laid off from my teaching job several years ago, I was pretty low. I’d lost a job I loved, and didn’t know what I was going to do next. \r\n\r\nBut then a funny thing happened. My neighbor came to me desperate to find a tutor for her son, who was struggling in school. I offered my services as a temporary solution. Fast forward two years later and I’m running my own tutoring business and making progress with my mental fitness website, Readybrain.net. \r\n\r\nI’ve never been happier, and I want to help those going through a tough spot in their careers feel like I do. If you’re up for receiving a guest article, I’d love to offer my advice on how to start a business after a career setback and tips for how to do it. I have some great resources and experience that could be highly beneficial for your readers. \r\n\r\nI look forward to hearing from you. \r\n\r\nThank you!\r\nLarry\r\n\r\nLarry Mager\r\nReadybrain.net | larry@readybrain.net\r\n', 'Dallas', 'TX', 6, '2018-04-03', '2018-04-03', '', '', '', '', '', 0, 16, 0, 'No', '2018-04-03 18:11:49', '2018-04-04 13:08:55'),
