(1229, 6, 35, 1, '2018-04-13', 'Alan', 'Matthew', 'alan@lawyermobileapp.com', '6305928201', '', 'http://www.galeandvallance.com/contacts/', 'Greetings,\r\n\r\nApps Legal is proud to announce the launch of our new ‘Car Accident Mobile App’. After having developed our App for over 350 PI firms, we carried out extensive research, talked to several prominent PI lawyers and finally created a solution that not only helps law firms in branding and marketing but also helps them generate new leads.\r\n\r\nKey Features of the App:\r\n1) Accident Site Evidence Collection Kit\r\n2) Important Personal Injury Resources\r\n3) Find Emergency Services\r\n4) Easy Client Referral\r\n5) Pain Journal\r\n6) Task Manager\r\n7) Expense Manager\r\n\r\nVideo App Marketing \r\nWe first develop a custom branded PI Mobile App for your firm and then create a \\\'viral video\\\' of the App. This video is then marketed on Facebook. We assure you of getting 10,000+ views on the video and 1000+ downloads on the App.\r\n\r\nFor information on the App and pricing details, please visit lawyermobileapp.com\r\n\r\nTo schedule a free demo of the App. Please contact me via email.\r\n\r\nTo unsubscribe. Please reply to this mail with \\\'unsubscribe\\\'.', 'Elmhurst', 'Illinois', 6, '2018-04-13', '2018-04-13', '', '', '', '', '', 0, 16, 0, 'No', '2018-04-13 07:25:36', '2018-04-13 08:09:38'),
(1230, 6, 12, 1, '2018-04-13', 'John', 'Murphy', 'jm@topestimators.com', '3476823801', '', 'https://www.customwinecellarslosangeles.com/contact/', 'Hi,\r\nWe provide Cost Estimating and Quantities Take-Off services for General As well as Sub-contractors. We do both residential and commercial projects. We have more than 12 years of experience in Estimating services. We are giving almost 40% Discount on first estimate and further on it\'ll be collaborated with 35-40% Discount on estimates with no compromise on quality of work. We are giving 98% accuracy on quantities with money back guarantee.\r\nTo get started, you just need to send us the Plans/Drawings as a PDF attachment or share a link to access Plans. Then we will get back to you with a Proposal/Quotation on that which includes our charges (i.e. how much we will charge for the estimate) as well as the turnaround time(the time required to complete the specific job). After your approval on the proposal, our experienced team of Estimators will start working on your estimate. In order to get a better idea of our work, please ask for sample estimates and take-offs. For further information please contact us at 347-682-3801.\r\n\r\nJohn Murphy  // Head – Estimation Division\r\nUSA TOP ESTIMATORS,LLC ®  (ACCURACY WITH EFFICIENCY)\r\nOffice : 1304 Beach Ave, Bronx, NY 10472 , USA\r\nE:   jm (at)topestimators(dot) com\r\nA EMAIL: usatopestimators (at) gmail (dot) com        \r\nW:  topestimators(dot)com\r\n\r\nTHIS EMAIL IS SIMPLE TO AVOID SPAM, PLEASE LET US KNOW IF YOU ARE INTERESTED SO WE CAN SEND YOU MORE INFORMATION, SAMPLES ETC \r\n\r\n', 'Bronx', 'NY', 6, '2018-04-13', '2018-04-13', '', '', '', '', '', 0, 16, 0, 'No', '2018-04-13 09:21:10', '2018-04-13 09:31:35'),
