(1621, 2, 33, 1, '2018-05-31', 'Nafisa Khwaja', 'Not Specified', 'nafisa@khwajalaw.com', '657-201-8687', '', 'https://www.incorporationattorney.com/incorporation-attorneys-california-about', 'Hello Incorporation Attorneys Team,\r\n\r\nMy name is Nafisa Khwaja, and I am an attorney specializing in intellectual property.  I often work with clients who have been referred from my business attorney colleagues who are looking for quality patent, trademark, and copyright services at very competitive prices.  In exchange, I offer my business attorney colleagues a referral fee for the clients they send over.  I would love to have a discussion with your firm to see how our firms can benefit each other.  I  look forward to hearing from you.\r\n\r\nBest regards,\r\n\r\nNafisa Khwaja\r\nAttorney at Law\r\nKhwaja Law, P.C.\r\nnafisa@khwajalaw.com\r\n657-201-8687', 'Not Specified', 'Not Specified', 6, '2018-05-31', '2018-05-31', '', '', '', NULL, '', 0, 0, 0, 'No', '2018-05-31 14:34:35', '2018-05-31 14:34:35'),
(1622, 2, 33, 1, '2018-06-01', 'Jacques Makhoul', 'Not Specified', 'jmakhoul12@gmail.com', '408-316-5389', '', 'https://www.incorporationattorney.com/schedule-a-free-meeting-business-lawyers-orange-county-california', 'Hi,\r\n\r\nI have my own company with no employees. I did software consulting work for a consulting company. There is a one-week of work for the first week of May 2018 \r\n\r\nthat they\'re refusing to pay. \r\n\r\nAfter calling them repeatedly, they sent me a cease and desist letter. As a result of that, I sent them a cease and desist letter threatening them with a \r\n\r\nlawsuit too. \r\n\r\nI have two questions: \r\n\r\n1. Can I still continue to call them to try to get my money despite the fact that they threatened with a lawsuit and protective order in their letter while \r\n\r\nI also threatened them back the same way. In other words, should I take their threat seriously or just ignore it. \r\n\r\n2. Is it a good idea to have your law office send them a threatening letter instead to pay me and how much would it cost to have a letter mailed to them. \r\n\r\nThanks,\r\n Jacques', 'Not Specified', 'Not Specified', 6, '2018-06-01', '2018-06-01', '', '', '', NULL, '', 0, 0, 0, 'No', '2018-06-01 02:48:20', '2018-06-01 02:48:20'),
