(1810, 2, 33, 1, '2018-07-13', 'JERRY', 'Not Specified', 'jerry@sagperformance.com', '7854082911', '', 'https://www.incorporationattorney.com/incorporation-attorneys-california-about', 'I own small business in Angola, IN.  SAG Performance Group /ZL1 Speed Shop.  I am interested in a free consultation to review information to determine if American Express and or Intuit can be sued for honoring a fraudulent charge-back. I had a customer who purchased a new item of merchandise for $4039.00. The new item had to be special ordered from GM Chevrolet, and was then sent to the purchaser. The purchaser signed for the transaction and there was proof of delivery. The purchaser then initiated a charge-back with American Express and was refunded the purchase amount, and has kept the merchandise. The purchaser will not return the merchandise. My merchant bank is now threatening to turn me over to collections if I do not pay them $4039. I have told them that American Express has to follow laws that govern their charge-back decisions and they cannot allow a person to purchase an item with a card,  file charge-back with the intent to keep the item without just cause, and at same time get their money back. Purchaser will not return item, ignores registered letter and email, and has effectively stolen the merchandise leaving me/my sole prop company on the hook for a $4000+ collections and putting my credit worthiness at risk. I sent to Intuit (my merchant bank/the card payment processor), some 30 pages of documents proving this was a consumer/cardholder committing credit card charge-back fraud, along with showing proof that the cardholder has lied in his reasoning for charge-back after receiving the merchandise. I am told by Intuit that American Express refuses to deny the cardholder a refund, American Express has failed to address my documents and will not give any response to them. American Express has not asked cardholder to return merchandise or to attempt to resolve any dissatisfaction or complaint with my company before initiating a charge-back.  Intuit has denied my dispute of the fraudulent charge back stating they have to go along with American Express\'s decision, and \"they cannot tell Amex how to run their business\".  I  have been told there is an oversight body that keeps watch over American Express in how it operates. It appears American Express has failed to review my dispute documents correctly or consider the facts of what has transpired, thus allowing its card member to purchase a $4000+ item of new merchandise, keep it, and received full refund without returning the merchandise. Purchaser/cardmember Armando Flores of Florida was sent registered letter and given an RMA for return of the merchandise and never complied, and has ignored my attempts to contact him to resolve this matter. I suspect American Express and/or Intuit has not followed the law in this particular circumstance. Contact me Jerry Long , jerry@sagperformance.com or phone 260-665-1633 if you know of any attorney or law firm that would be interested in taking this case based solely on a contingency fee. Instead of billing by the hour, that is the lawyer waits until the case is over, then takes a certain percentage of the amount won. The lawyer or law-firm would be entitled to any compensation unless the case was won, and this compensation should only be a percentage of the proceeds that American Express and/or Intuit would be ordered to pay by the court.\r\n\r\nAmerican Express Company\r\n\r\nExecutive Offices\r\n\r\n200 Vesey Street\r\n\r\nNew York, New York 10285\r\n212-640-2000\r\n\r\n\r\nIntuit Inc.\r\nHeadquarters\r\nAddress: 2700 Coast Ave\r\nMountain View, CA 94043\r\nPhone: 650-944-6000', 'Not Specified', 'Not Specified', 6, '2018-07-13', '2018-07-13', '', '', '', NULL, '', 0, 0, 0, 'No', '2018-07-13 08:19:17', '2018-07-13 08:19:17'),
